C.aqN=new L.C("You can modify the width of the menu and sidebar. In this demo the menu and its drawer, likewise the sidebar and its end drawer, share the same width for simplicity of this demo. With the API you can set the width of their pinned to screen mode, separately from their drawer widths.",null,null,null,null,null,null,null,null)
C.ahJ=new T.G(C.Z,C.aqN,null)
C.aoN=new L.C("These settings are not Flexfold or even demo app related, they show how you can enrich your app with a few settings that can be helpful during development and testing.\n\nPlatform mechanics change how the application user interface behaves. You can make text editing and scrolling on an Android device behave like on an Apple device and wise versa. Normally you would leave it at the default, but if you for example prefer using iOS scrolling physics on Android, feel free to switch. Changing this setting is mostly useful for testing.\n\nNormally the device locale would change the LTR and RTL text direction and layout of the program. This simple demo uses no locale in this release, but it can wrap itself with a given Directionality. You can use this to test and verify how the layout of Flexfold changes with LTR and RTL directionality.",null,null,null,null,null,null,null,null)
C.ahM=new T.G(C.Z,C.aoN,null)
C.apQ=new L.C("You can choose between Material or Cupertino bottom navigation bar. The choice can also be platform adaptive. Other bottom navigation bar styles may be added in future versions. The Material bottom navigator uses standard theming and properties. It also support transparency  and Cupertino style frosted glass blurring.",null,null,null,null,null,null,null,null)
C.ahO=new T.G(C.Z,C.apQ,null)
C.aq6=new L.C("Users can toggle the menu and sidebar visibility by clicking on their menu buttons. The menu buttons only toggle the menu and sidebar between possible states based on current canvas size and breakpoint constraints.\n\nIf you do not want users to be able to manually toggle the rail and menu modes or show and hide the sidebar, then you can disable the toggle controls. When they are disabled, the menu modes are locked to the mode given by current canvas size, the breakpoints and other menu visibility constraints you have defined.",null,null,null,null,null,null,null,null)
C.ahU=new T.G(C.Z,C.aq6,null)
C.aqX=new L.C('With "Custom theme" you can select enabled primary and secondary colors, any inactive colors will be calculated. You can also modify error color and select app bar color independently of the primary color.\n"Custom surface" enables color selection of background, surface and scaffold background colors.\nThe onColors are always computed in this demo, but the FlexColorScheme API allows you to define them as well.',null,null,null,null,null,null,null,null)
C.ahY=new T.G(C.Z,C.aqX,null)
C.apa=new L.C("Using edge borders can give your app a more defined look, but you may not need them with themes that blend in primary color. With the API you can also control the edge border color. By default it use the divider theme color.",null,null,null,null,null,null,null,null)
C.ai0=new T.G(C.Z,C.apa,null)
C.apc=new L.C('The menu has its own app bar locked to the top, when expanded from Rail to Menu you can often fit a company logo or app, brand name in it. After menu\'s app bar there is a leading widget before the actual menu destinations, that are then followed by a trailing widget and finally a footer that sticks to the bottom.\n\nYou do not have to use leading, trailing and footer widgets, but they are available if you need them. The menu app bar and the menu footer do not scroll, but the rest of the menu widgets will scroll if the items do not fit vertically.\n\nA FlexfoldDestination class is used to define navigation destinations. You can define if a destination is included in the bottom navigation mode or not. For the menu you can define if there is a divider before or after a destination, and if it has a heading. Does the destination have a FAB? Maybe a sidebar too? The configuration is very similar to NavigationRail destinations, but with a few more properties. Flexfold also has a custom theme "FlexfoldThemeData" used to style the Flexfold scaffold and set values for less used properties.',null,null,null,null,null,null,null,null)
