C.aoK=new L.C("For the page content layout, there is a Breakpoint class used to get suitable amount of columns for the grid images. It can be used to create different grid layouts all the way up to 4k widths. This screen is a nice stress test on a large canvas. If you maximize the screen on a 4K display and toggle the menu, the menu animation will cause all the SVG images on the screen to be rescaled and redrawn in every frame as the menu animates. It is a good stress test of Flutter and it actually works very well, much better than resizing windows in Flutter does. Window resizing and resulting redraws still need improvements in Flutter. This demo app could perhaps be better optimized too.\n\nThe Undraw images bundled with the app are used as demo content in the grid. Each image box that randomly display one of the images, has its own random wait duration before it switches, they also have a random switch animation time. Each image box gets a random colored border box, a less saturated version of the color is calculated for dark mode. Thus when you switch to dark mode, it still has the same color hue based on the light theme's random color. If you toggle the theme using the side menu toggle, you can see the difference. A nice detail is that each image is also using the same color as the border, as the color theme of each image.\n\nThere are only 30 different images that are switched in randomly to each position in the grid. This demo list stops at 500 items in the grid. As such the page is not very useful, but it's a nice looking Flutter stress test, especially on the web.\n\nWith this page you can also test and see how Slivers work when the sidebar is a part of Scaffold body or outside it. It has bigger visual impact when a bottom navigation bar is used on a large canvas layout. Here we can use the toggle to always show the bottom navigation bar to see the difference. The setting that shows the bottom bar when the menu is manually hidden and sidebar remains pinned visible, is probably a more real use case for when the bottom navigation bar would be used on a large canvas.\n",null,null,null,null,null,null,null,null)
