C.ap_=new L.C("Theming is not a part of Flexfold, it is included as an extra feature in this demo application. The theming shown here is done with another package called FlexColorScheme. This page presents the kind of theming that is simplified by using it.\n\nFlexColorScheme uses Flutter's newer ColorScheme based themes. It is similar to the standard ThemeData.from in that a theme is created from a ColorScheme. It has two convenience factories, FlexColorScheme.light and FlexColorScheme.dark. FlexColorScheme also address some theme gaps in the standard Theme.from ColorScheme.\n\nFlexColorScheme supports using material and custom surface colored app bar themes in light and dark mode. Dark mode also support a darker mode than Material default dark, called true black. Different levels of branded surface colors, with primary color blended into surfaces, can be used to create color branded light and dark themes.\n\nIn addition to the default material design standard theme, which is also included in the Flutter's ColorScheme, FlexColorScheme comes comes with a few extra themes to get you started with theming your app.\n",null,null,null,null,null,null,null,null)
C.ap0=new L.C("When enabled, users can use the end drawer menu button to hide and show the sidebar, if it is possible to do so based on canvas size and breakpoint constraints.",null,null,null,null,null,null,null,null)
