C.ap4=new L.C("The breakpoints for when the navigation mode changes, can be adjusted. The defaults work well enough for most use cases.\n\nTo keep the rail as slim as possible, navigation destination labels only appear as tooltips in rail mode. This results in a slim un-intrusive icon only rail, that is suitable for tablets in portrait mode and if so desired, it can also be used in landscape mode on phones.\n\nA sidebar using an end drawer, that can also become a permanent fixture on a wide enough canvas, is also supported. The sidebar entrance also animates when its breakpoint is exceeded. The sidebar's visibility as a permanent fixture can also be toggled with its menu button.\n\nThe widths of the rail, side menu and the tools menu can be individually adjusted. \n\nIn this demo you can play with the settings and observe Flexfold in action. The Flexfold API has even more features than those demonstrated in the demo.\n\nYou will find the key settings on the Setup page, but there are some usage hints and setup info gems on other pages in the this demo app as well.",null,null,null,null,null,null,null,null)
