C.api=new L.C("A toggle to lock and minimize the menu on a large canvas is built in to the menu button. It enables users to hide the side menu or rail, in order to make more space available for the app content. You can hide the menu completely or make it a rail, also on desktop and web canvas sizes. Similar menu toggle control is also available for the optional sidebar, that can be in the end drawer or pinned to the screen on a large canvas.\n\nThe tooltips on the settings controls below show the Flexfold API used to control the operated setting. You can turn OFF the tooltips under Other settings. The purpose of these API tooltips is to function as an interactive reference guide to Flexfold.",null,null,null,null,null,null,null,null)
