C.apn=new L.C('In addition to the tapped indexes, the destination\'s named route is included as a return value in the class. The "Tapped via" source, index change "Direction" are also included. You can use this information to determine how you want to navigate to the destination.\n\nThis demo shows how the destination information can be used to build different page transitions depending on which menu you navigate from. For example, from locked side menu there is no page transition. This works well with Web and desktop navigation. It is focused and quick, also animation of large surfaces on desktop sizes can be very distracting. At most a very quick and subtle fade through could be used if some navigation animation is desired. For this demo it was opted to not have any animation for this navigation type.\n\nFrom a rail or a drawer the FadeTrough transition from the Flutter Animations packages is used. This works well in tablet mode or when the direction of the navigation is uncertain. We can also see that only the actual content of the page animates. The rail, bottom bar, app bar and sidebar do not animate and remain fixed.\n\nThe bottom navigation uses a shared axis transition. This creates a slight sideways motion as the bottom destinations are clicked, without the same feeling that they are a part of same view that sliding animations imply, which would also suggest swiping navigation is available. Swiping navigation is not available here, since in this demo we consider the bottom navigation destinations to be independent of each other.\n\nThe purpose of different page transition types, is to use transitions that fit and feels at home with the most likely devices used for each navigation. This type of adaptive page transitions is not built into Flexfold. It handles the responsive scaffold layout and via the "onDestinationSelected" callback returns the information need to navigate to selected destination and also information needed to be able to do so differently based on which navigation mode was used to select the target navigation destination. \n',null,null,null,null,null,null,null,null)
