C.apL=new L.C("The Material guide shows the sidebar as a part of the scaffold body. Turn ON this setting to follow the guide. Flexfold defaults to having it outside the body, like side menu and rail. It also gets its own app bar when locked to the side. The setting affects if a bottom bar covers the sidebar or not and impacts standard FAB locations when the sidebar is visible.",null,null,null,null,null,null,null,null)
