C.apP=new L.C('The Flexfold layout design is primarily intended for Flutter applications that target Desktop and Web, but it is also useful for resizable apps on tablets and Chrome books. Sure, it works great for switching between portrait and landscape mode on phones and standard tablets too, offering navigation mode flexibility on them as well.\n\nFlexfold is useful when you make a single app that needs to support layout and navigation on phones, tablets, desktop and web canvas sizes using the same code base.\n\nThis Flexfold feature demonstration application uses named routing. You do not have to use named routes, but it is recommended. Named routes are easy with Flexfold and they also enable URL based routes if you plan to release your Flutter app on the Web. The "onDestinationSelected" callback from the Flexfold package provides not just an index for the tapped destination, but a class with the values that you see in each page header in this demo.\n',null,null,null,null,null,null,null,null)
C.apR=new L.C("To assist with responsive app development, you can show current canvas size in the styled app bar. This is usually not a setting you want to enable for end users, but useful during development.",null,null,null,null,null,null,null,null)
C.apS=new L.C("\nThis demo app does not expose any settings for the FABs, but the pages Setup and Theme have been configured to have and show Floating action buttons.\n\nWith the API the FAB position can also be defined for each navigation mode separately, so that the FAB shows up as expected on the bottom right in phone bottom navigation mode and on the top in tablet and desktop mode or wherever you want it to be in each mode.\n\nOn the todo list is to add some pre-configured FAB locations that will also place the FAB on the edge of the rail or menu.",null,null,null,null,null,null,null,null)
