C.aqH=new L.C('This feature is required so you do not get stranded without a way back to bottom bar destinations in this navigation mode. Another and a better way to tackle this is to push the destinations that are only in the drawer in this navigation mode as new modal full screen on top of the entire Flexfold scaffold, with only back navigation option available. This is the normal and often preferred way of navigating from such extra drawer destinations on a phone.\n\nThis example application has been designed to do so by default, by using the "use modal" info returned by the FlexfoldSelectedDestination information for such destinations, which are Preview, Help and About in this demo app.\n\nEven when using this capability, it is still potentially possible to get stranded. If you in rail or menu mode navigate to Help or About the destination should not be pushed as a full screen with only back option, preferably we should only get the destination content replaced into the body part of the app. This demo app works this way. However, in this mode if you then resize the canvas to enable bottom navigation mode, the Home, Help and About views in this app do not know that they should change to full screen view with a back button taking user back to last used bottom navigation destination. With Flexfold navigation to the bottom destinations will still be possible even in this rare scenario, since the are destinations are now automatically present in the drawer.',null,null,null,null,null,null,null,null)
C.aqI=new L.C("Selected list tile sub title",null,null,null,null,null,null,null,null)
C.aqL=new L.C("TEXT BUTTON",null,null,null,null,null,null,null,null)
C.aqM=new L.C("Side borders on drawers in dark mode are ON by default. In true black mode they are really needed. With the API you can change their color. There is also an API to enable side borders for light mode. It is OFF by default as it is normally not needed.",null,null,null,null,null,null,null,null)
